import React, { Component } from 'react';
import PropTypes from 'prop-types';
import {connect} from 'react-redux';
import {fetchRequest} from './redux/actions/fetchRequestAction';
import App from './App';

const propTypes = {

};


class MainComponent extends Component {
    componentDidMount(){
        this.props.fetchRequest();
    }
    render() {
        console.log(this.props.getItems)
        return (
            <div>
            {this.props.getItems.length === 0 ? <span>loading</span> : this.props.getItems.map(({full_address, images, area, price}) => 
                <App 
                    fullAddress={full_address}
                    images={images}
                    area={area}
                    price={price}/>
            )}
            </div>
        );
    }
}
const mapStateToProps = (store) => ({
    getItems: store.getItems,
})

const mapDispatchToProps = (dispatch) => ({
    fetchRequest:  () => {
        dispatch(fetchRequest())
    },
})

MainComponent.propTypes = propTypes;


export default connect(mapStateToProps, mapDispatchToProps)(MainComponent);
